import { useState } from 'react';
import './App.css';
import CreateCategoryCard from './components/functions/cerateCategoryCard';
import CategoriesDiv from './components/css/categoriesStyle';


function App() {
  const [users, setUsers] = useState([]);

  function fetchSomething() {
    fetch('/api')
      .then(res => res.json())
      .then(data => setUsers(data));
  }

  return (
    <div className="App">
      <h1>Ctegories</h1>
      <button onClick={fetchSomething}>Fetch Data</button>
      <ul>
        {users.map(user => (
          <li key={user.id}>{user.name}</li>
        ))}
      </ul>
      <div className={CategoriesDiv.cat}>
      <CreateCategoryCard />
      </div>
    </div>
  );
}

export default App;
